INSERT INTO `jms_job` VALUES (1, '{"name": "姜维", "avatar": "https://shopzz.oss-cn-guangzhou.aliyuncs.com/other/a1.jpg", "jobTitle": "老板"}', 1688847724483538944, 1, 'Java高级开发工程师', 15000, 20000, '{"payDay": "15日", "subsidy": ["餐补", "房补", "交通补助", "夜班补助", "绩效奖金", "全勤奖", "加班费", "工龄奖"], "basicSalary": 5000, "socialSecurity": "六险一金"}', 3, 5, 22, 40, '本科', '["Java开发", "Spring", "金融项目"]', '【招聘岗位和招聘对象】\r\nTT数据存储项目招聘 软件开发工程师和软件测试工程师。\r\n招聘对象：社招有1年以上工作经验的JAVA/C++/C/PYTHON/JS软件开发或者软件测试人员\r\n【职责】\r\n1、热爱编程，基础扎实，熟悉掌握但不限于JAVA/C++/C/PYTHON/JS等编程语言中的一种或数种，有良好的编程习惯。掌握常用数据结构和算法。\r\n2、从事软件开发工作，完成客户需求到软件产品定义、架构设计、开发实现、再到上线运营维护等产品生命周期中的各个环节。\r\n3、解决实现过程中的技术难题，提升产品的核心竞争力。\r\n4、善于沟通、乐于合作，热衷新技术，善于总结分享，喜欢动手实践。\r\n5、【优先考虑】了解主流的存储协议HDFS、AWS S3、OpenStack SWIFT、NFS、CIFS、SMB一种或多种；了解大数据生态圈的主要组件Hadoop、Spark、Hive、HBase、Flume一种或多种；了解相关的开源软件Jetty、memcache、ElasticSearch、Redis、Zookeeper一种或多种。\r\n6、【优先考虑】了解主流的存储协议者优先考虑；了解对象/块/文件/大数据存储一种或多种，数据保护等优先考虑；有AI/HPC（高性能计算）/HCSO（TT云服务在线）/ 对象资源池/云化等海量数据场景的研发经验者优先。\r\n【关于我们】\r\nWhat we are \r\nTT存储产品围绕数据全生命周期，从数据的智能感知，数据存储到数据的智能分析和数据的保护， 打造非结构化存储研发中心，帮助企业释放海量数据价值，让数据的每一比特发挥最大价值。\r\nWhat we do\r\n海量存储聚焦云化、大带宽、大数据等海量数据场景，为大数据分析/ HPC/视频图像处理/备份归档/虚拟化/云资源池/AI等应用提供多样性存储服务，围绕极致融合、极致性能、极致可靠性、多云流动，构筑全球领先的竞争力。\r\nWhat you can get \r\n在这里，活力四射的团队，不可多得的机会，你可以尽情发挥你的才能。\r\n在这里，领先业界的黑科技，互联网最前沿的技术，这里是技术控的最佳选择。\r\n在这里，天才少年、博士团、技术大牛已加盟，和优秀的人共事，成为更优秀的人。', 0, 114.915607, 37.632311, 'http://tt-zhipin-oss.oss-cn-shenzhen.aliyuncs.com/2023/08/f0a0b38a-56ea-4474-a9bd-1ce9f10001ab.png', '中国', '湖南', '长沙', '岳麓区', '橘子洲头', 1, 1, 0, '2023-08-09 15:35:12', '2023-08-09 16:34:33');
